	/** The date of the last Git commit. */
	public static final String GIT_DATE = "2024-09-08 18:11:02 EDT";

	/** The name of the Git branch. */
	public static final String GIT_BRANCH = "main";

	/** The date and time when the project was built. */
	public static final String BUILD_DATE = "2024-09-08 20:42:47 EDT";

	/** The Unix timestamp of when the project was built. */
	public static final long BUILD_UNIX_TIME = 1725842567667L;

